import React, { useState } from 'react';
import { fetchData } from '../api';

const HealthForm = () => {
    const [formData, setFormData] = useState({
        age: '',
        height: '',
        weight: '',
        activityLevel: '',
        gender: '',
        dailyWaterIntake: '',
        sleepHours: '',
        stressLevel: '',
    });

    const handleChange = (name, value) => {
        setFormData({
            ...formData,
            [name]: value
        });
    };

    const handleSubmit = async () => {
        const data = await fetchData('/predict', formData);
        console.log('Erhaltene Daten:', data);
        // Hier kannst du die erhaltenen Daten weiter verarbeiten oder anzeigen
    };

    return (
        <div style={styles.container}>
            <label>Alter:</label>
            <input
                type="number"
                style={styles.input}
                value={formData.age}
                onChange={e => handleChange('age', e.target.value)}
            />
            
            <label>Größe (cm):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.height}
                onChange={e => handleChange('height', e.target.value)}
            />

            <label>Gewicht (kg):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.weight}
                onChange={e => handleChange('weight', e.target.value)}
            />

            <label>Aktivitätslevel:</label>
            <input
                type="number"
                style={styles.input}
                value={formData.activityLevel}
                onChange={e => handleChange('activityLevel', e.target.value)}
            />

            <label>Geschlecht:</label>
            <select
                style={styles.input}
                value={formData.gender}
                onChange={e => handleChange('gender', e.target.value)}
            >
                <option value="">Bitte wählen...</option>
                <option value="1">Männlich</option>
                <option value="2">Weiblich</option>
            </select>

            <label>Tägliche Wasseraufnahme (Gläser):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.dailyWaterIntake}
                onChange={e => handleChange('dailyWaterIntake', e.target.value)}
            />

            <label>Schlafstunden:</label>
            <input
                type="number"
                style={styles.input}
                value={formData.sleepHours}
                onChange={e => handleChange('sleepHours', e.target.value)}
            />

            <label>Stresslevel (1-10):</label>
            <input
                type="number"
                style={styles.input}
                value={formData.stressLevel}
                onChange={e => handleChange('stressLevel', e.target.value)}
            />

            <button style={styles.button} onClick={handleSubmit}>Absenden</button>
        </div>
    );
};

const styles = {
    container: {
        padding: '20px',
    },
    input: {
        height: '40px',
        borderColor: 'gray',
        borderWidth: '1px',
        marginBottom: '10px',
        paddingLeft: '8px',
        display: 'block',
        width: '100%',
        boxSizing: 'border-box'
    },
    button: {
        padding: '10px 20px',
        backgroundColor: '#007BFF',
        color: '#fff',
        border: 'none',
        cursor: 'pointer'
    }
};

export default HealthForm;
